window.bookSummaryJSON = "<p>Audible presents the start of a thrilling new enemies to lovers, sapphic romantasy trilogy, for fans of Sarah J Maas, Leigh Bardugo and Rebecca Yarros, performed by Jessie Mei Li (<i>SHADOW AND BONE</i>) and Freya Mavor (<i>INDUSTRY</i>)</p> <p>In the kingdom of Eynhallow, Princess Ythsie is preparing to choose a husband, in order to secure the kingdom’s future. Everything changes when Stroma, a skilled fighter from a remote village, becomes her new bodyguard. As mysterious deaths rock the palace, Ythsie and Stroma uncover a web of ancient magic and deadly court intrigue. The princess discovers she has a rare and dangerous gift - the ability to communicate with the Deathless, Eynhallow's cursed undead army.</p> <p>Amidst the chaos, rivalry blossoms into romance between the princess and her loyal squire. With enemies closing in and the fate of the kingdom at stake, Ythsie and Stroma must navigate treacherous alliances, their growing feelings for each other, and their own destinies. How far will they go to protect their love and save their homeland?</p>"; 
